import collections


class Solution(object):
    def findTheDifference(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: str
        """
        return list((collections.Counter(t) - collections.Counter(s)))[0]

if __name__ == "__main__":
    so = Solution()
    string = ""
    tring = ""
    res = so.findTheDifference(string, tring)
    print(res)
